import React from 'react';
import '../styles/App.css';

const Contact = () => {
  return (
    <main className="contact-container">
      <h1>Contact</h1>

      <div className="contact-info">
        {/* Add studio location if available */}
        {/* <p className="studio-address">Studio, [Address]</p> */}

        <p className="email-contact">
          <a href="mailto:contact@cakenygard.com">Send me an email</a>
        </p>

        <p className="social-contact">
          <a href="https://www.instagram.com/cakenygardart/" target="_blank" rel="noopener noreferrer">
            Instagram: @cakenygardart
          </a>
        </p>
      </div>
    </main>
  );
};

export default Contact;
